import React from 'react'
import styled from 'styled-components'

const StyledTextiles = styled.div`
//  background-color: cyan;
  height: 100vh;
  display: flex;
`

const StyledTiles = styled.div`
  background-color: cyan;
  height: 250px;
  width: 100px;
  margin: 0 1rem;
`

const tiles = ['one', 'two', 'three']


const Textiles = (props) => {
  return (
    <StyledTextiles>
      { tiles.map(elem =>  <StyledTiles/> )}
    </StyledTextiles>
  )
}

export default Textiles
